import React, {Component} from 'react';
import { Table, Button} from "reactstrap";

class Cart extends Component {
    render() {
        return (
            <div className="cart">
                <Table>
                    <thead>
                    <tr>
                        <th>Product Name</th>
                        <th>Price</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        {
                            this.props.cart.map(item => (
                                <td>{item.unitPrice}</td>

                            ))
                        }
                    </tr>
                    <hr/>
                    <b>TOTAL PRICE : {this.props.totalPrice}$</b>
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default Cart;
